script: |
  super -f text -I q7416.spq | sort > q7416.out

inputs:
  - name: q7416.spq
    data: |
      SELECT col1 * CAST ( ( + 41 ) AS INTEGER ) AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE - col2 / + - col2 + - 39 NOT BETWEEN - col2 AND 45 * col0 + col1;
  - name: tab1

outputs:
  - name: q7416.out
    data: |
